INSERT INTO `node_revisions` (`nid`, `vid`, `uid`, `title`, `body`, `teaser`, `log`, `timestamp`, `format`) VALUES
(1, 1, 1, 'Mercenary captain', 'A Mercenary Captain is a tough professional warrior, a man who will fight for anyone or against anything so long as the price is right. Mordheim offers such a man the chance to become rich beyond his dreams, though at great risk. But as ruthlessness and lack of mercy and pity are the hallmarks of a successful Mercenary Captain, it is no wonder that they flock to Mordheim.', 'A Mercenary Captain is a tough professional warrior, a man who will fight for anyone or against anything so long as the price is right. Mordheim offers such a man the chance to become rich beyond his dreams, though at great risk. But as ruthlessness and lack of mercy and pity are the hallmarks of a successful Mercenary Captain, it is no wonder that they flock to Mordheim.', '', 1277324430, 1),
(3, 3, 1, 'Champions', 'In any Mercenary warband there is one warrior who is bigger, stronger (and often uglier) than his comrades. These men are called Champions (or berserkers, first swordsmen and various other names). Champions are amongst the toughest and the best fighters in the warband. They often answer challenges issued to the warband and, after the Captain, they get the pick of any equipment and loot.', 'In any Mercenary warband there is one warrior who is bigger, stronger (and often uglier) than his comrades. These men are called Champions (or berserkers, first swordsmen and various other names). Champions are amongst the toughest and the best fighters in the warband. They often answer challenges issued to the warband and, after the Captain, they get the pick of any equipment and loot.', '', 1277325342, 1),
(4, 4, 1, 'Youngbloods', 'These are young fighters who are still inexperienced, but eager to win their spurs in the savage fighting in and around the ruins of Mordheim.', 'These are young fighters who are still inexperienced, but eager to win their spurs in the savage fighting in and around the ruins of Mordheim.', '', 1277325218, 1),
(5, 5, 1, 'Warriors', 'These dogs of war are grim, seasoned fighters, fearing no man as long as they have their weapons and armour. They form the core of any Mercenary warband.', 'These dogs of war are grim, seasoned fighters, fearing no man as long as they have their weapons and armour. They form the core of any Mercenary warband.', '', 1277325272, 1),
(6, 6, 1, 'Marksmen', 'The archers and hunters of the Old World are famed for their skill, and it is said that they can hit a coin from 300 paces with a long bow. In the savage street fights of Mordheim they snipe at the enemy from the windows of ruined buildings and pick out enemy leaders with their arrows.', 'The archers and hunters of the Old World are famed for their skill, and it is said that they can hit a coin from 300 paces with a long bow. In the savage street fights of Mordheim they snipe at the enemy from the windows of ruined buildings and pick out enemy leaders with their arrows.', '', 1277325519, 1),
(7, 7, 1, 'Swordsmen', 'Swordsmen are professional warriors, experts at taking on and beating several opponents at once. They are much sought after by warband leaders, as their skills are ideally suited for fighting in Mordheim.', 'Swordsmen are professional warriors, experts at taking on and beating several opponents at once. They are much sought after by warband leaders, as their skills are ideally suited for fighting in Mordheim.', '', 1277325672, 1),
(8, 8, 1, 'Creation of the Warhammer game website ', 'Creating warbands\r\n\r\nTo create the warbands I have chosen to create a node of the type "warband" and use the CCK module to specify the attributes.\r\nCCK Fields like weapon skill, movement, strength, cost, description of the unit were used.\r\n\r\nI have installed the node clone module to be able to create user specific warbands. Source unit noded can be cloned to create user specific units. This function can be used to clone a node in the code:\r\n\r\nmodule_load_include(''inc'', ''clone'', ''clone.pages'');\r\n$new_nid = clone_node_save(1);\r\n\r\nA new node is created and $new_node is the id of the newly created unit.\r\n\r\n\r\nCreating a movement path on the field.\r\n\r\nFor the movement of the unit through the 4'' x 4'' field I have used a formula to draw a line. The line can be drawn by specifiying\r\nthe offset and end attributes. The field is an 2-dimensional array 48x48, where each element represents one inch of the field.', 'Creating warbands\r\n\r\nTo create the warbands I have chosen to create a node of the type "warband" and use the CCK module to specify the attributes.\r\nCCK Fields like weapon skill, movement, strength, cost, description of the unit were used.\r\n\r\nI have installed the node clone module to be able to create user specific warbands. Source unit noded can be cloned to create user specific units. This function can be used to clone a node in the code:\r\n\r\nmodule_load_include(''inc'', ''clone'', ''clone.pages'');\r\n$new_nid = clone_node_save(1);\r\n\r', '', 1277327688, 1);

